J.J. McQuade is a Texas Ranger who doesn&amp;#039;t exactly follow the rules, is unruly, and prefers to work alone, which earns the nickname, Lone Wolf McQuade. When he discovers some criminals have automatic weapons, he discovers that they were stolen from the military. He tries to handle on his own, as usual, but in the end, an old friend, and a prisoner, whom he was keeping under wraps, are killed. He is then relieved of duty. But then an FBI agent, who also wants to get these guys, offers to help McQuade, and along with a rookie, they track down the mastermind.


